const express = require('express');
const PORT = process.env.HTTP_PORT || 4001;
const app = express();
app.get('/', (req, res) => {
    res.send('flowers smell nice');
});
app.get('/flower', (req, res) => {
    res.json({
      name: 'Dandelion',
      colour: 'Blue-ish'
    });
});
app.listen(PORT, () => {
    console.log(`Server listening at port ${PORT}.`);
});

